import React from "react";

const VideoItem = props => {
  return (
    <div className="item">
      <div className="ui small image">
        <img alt="alt" src={props.thumbnail} />
      </div>
      <div className="middle aligned content">
        <a onClick={() => props.onVideoSelect} href={props.channelId} className="header">
          {props.title}
        </a>
      </div>
    </div>

  );
};

export default VideoItem;
